css:
@-moz-document domain("timeandexpense.myefaactweb.com") {
table {
    color: #000;
}

.timecard2013_layout_table {
    background-color: #22456a;
}

.timecard2013_taskheader_cell0, .timecard2013_taskheader_cell1, .timecard2013_taskheader_cell2 {
    background-color: inherit;
}

.timecard2013_task_cell0, .timecard2013_task_cell1 {
    color: inherit;
    font-size: inherit;
    vertical-align: middle;
}

.timecard2013_task_cell2 {
    vertical-align: middle;
}

.timecard2013_timegrid_webperiod_header {
    color: #000;
    background: #fff;
}

td#ctl00_cell_verisign {
    display: none;
}

.timecard2013_task_dailytotal {
    background-color: #a8d8eb;
    color: #000;
}

.timecard2013_timegrid_dailytotals {
    color: #000;
}

.timecard2013_weeklysummary_grid {
    color: #000;    
    border: outset 1px #255068;
}

.timecard2013_weeklysummary_grid tr th {
    background-color: #255068;
    color: #ffffff;
}

.timecard2013_weeklysummary_grid tr:last-child, .timecard2013_weeklysummary_grid tr td:last-child {
    font-weight: bold;
    background-color: #a8d8eb;
}

.timecard2013_timegrid_webperiod_links_header {
    background-color: #255068;
}

.timecard2013_userlabel {
    color: #000;
    background-color: #fff;
}

form, body {
    background-color: #fff;
}
}
